	 ('Công Ty Cổ Phần Sản Xuất Thương Mại Lúa Vàng Việt','945402710','Mr. Đào Duy Băng Thanh','Công Ty Lúa Vàng Việt là đơn vị sản xuất và cung ứng các loại gạo trắng thương phẩm, gạo lứt thô,.. Ngoài ra còn có các phụ phẩm gạo khác như tấm, cám và vỏ trấu. Với quy mô nhà máy lớn nhất Tây Ninh được thành lập vào năm 2018, chúng tôi mong muốn cùng các nhà phân phối đẩy mạnh hệ thống phân phối đến khắp các tỉnh miền Nam và cả nước, bên cạnh đó là xuất khẩu ra nước ngoài. Với sứ mệnh sánh vai và nâng cao sinh kế nhà nông, chúng tôi mang đến các sản phẩm gạo chất lượng cao, hợp khẩu vị và an toàn cho sức khỏe người tiêu dùng. Rất hân hạnh được hợp tác!','785-787 Cách Mạng Tháng tám, Khu Phố 2, Phường 3, Thành Phố Tây Ninh, Tây Ninh',135.8808324,'HACCP, VSATTP','thanhdao@ducthanhco.vn','Từ 51  - 100 người','Gạo - Công Ty Và Đại Lý Gạo;Xay Xát - Nhà Máy Xay Xát Lúa Gạo;Sản xuất;Toàn quốc, Quốc tế;HACCP, VSATTP','Gạo - Công Ty Và Đại Lý Gạo','2018','3901259282','2024-11-11 20:12:50','2024-11-11 20:12:50',3833.999555,'785 Cách Mạng Tháng Tám, Hiệp Ninh, Tây Ninh, Việt Nam',11.308933,106.1141946,'ChIJGXPpnFNqCzERwiHs1hwPApw'),
