	 ('Công Ty Cổ Phần Hoàng Minh Nhật','No phone','Hotline','Công Ty CP Hoàng Minh Nhật đến nay đã có hơn 10 năm kinh nghiệm trong ngành sản xuất và chế biến gạo xuất khẩu với hệ thống dây chuyển công nghệ máy móc hiện đại cùng đội ngũ cán bộ, công nhân viên dày dặn kinh nghiệm.Ngành nghề kinh doanh:- Gieo trồng, sản xuất, xay xát, và chế biến lúa gạo xuất khẩu- Kinh doanh lúa gạo- Cung cấp nguyên liệu chế biến thức ăn gia súc từ phụ phẩm lúa gạo (cám, tấm, ..)- Vận tải hàng hóa thủy nội địa và đường bộCác sản phẩm của chúng tôi đã và đang có mặt tại các thị trường quốc tế như Đông Nam á, Trung Đông, khu vực Châu á, Châu Phu và các nước Châu Mỹ,..Sản phẩm chính: - Gạo trắng hạt dài các loại 5%, 10%, 15%, 20%, 25%, 100% tấm- Các loại gạo trắng cho đặc tính mềm cơm, dẻo, thơm.','Số 18/2, Đường tỉnh lộ 922, ấp Thới Khánh A, xã Tân Thạnh, H. Thới Lai, TP. Cần Thơ',198.0810624,'HACCP','hmn@hmnfoodco.com','Nhà sản xuất, Công ty Xuất Khẩu','Gạo - Công Ty Và Đại Lý Gạo;Thức Ăn Chăn Nuôi - Nguyên Liệu Sản Xuất Thức Ăn Chăn Nuôi;Xay Xát - Nhà Máy Xay Xát Lúa Gạo;Nhà sản xuất, Công ty Xuất Khẩu;Toàn quốc, Quốc tế;HACCP','Gạo - Công Ty Và Đại Lý Gạo','Công Ty Cổ Phần Hoàng Minh Nhật','HACCP','2024-11-11 20:12:50','2024-11-11 20:12:50',2557.357374,'2 ĐT922, Định Môn, Thới Lai, Cần Thơ, Việt Nam',10.0883762,105.5907899,'ChIJvQBCrsuaoDERycYt6NvSI0I'),
