-- First, disable foreign key checks
SET FOREIGN_KEY_CHECKS=0;

-- Clear existing data
TRUNCATE TABLE Permission_Role;
TRUNCATE TABLE Permission;
TRUNCATE TABLE Role;
TRUNCATE TABLE Supplier;
TRUNCATE TABLE Parking;
TRUNCATE TABLE Vehicle;
-- Re-enable foreign key checks
SET FOREIGN_KEY_CHECKS=1;

ALTER DATABASE scm CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci;
ALTER TABLE scm.Supplier CONVERT TO CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.Supplier MODIFY description VARCHAR(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.Parking CONVERT TO CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.Parking MODIFY name VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.ProcurementPlans CONVERT TO CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.ProcurementPlans MODIFY destination VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;


ALTER TABLE scm.AuditLog CONVERT TO CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.AuditLog MODIFY url VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.AuditLog MODIFY activity VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.AuditLog MODIFY params VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.AuditLog MODIFY query VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.AuditLog MODIFY payload VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.AuditLog MODIFY response VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

ALTER TABLE scm.Parking CONVERT TO CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.Parking MODIFY name VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.Parking MODIFY address VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.Parking MODIFY formatted_address VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;


ALTER TABLE scm.Vehicle CONVERT TO CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
ALTER TABLE scm.Vehicle MODIFY vehicle_name VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
-- Modify createdAt to use CURRENT_TIMESTAMP as default
ALTER TABLE scm.Vehicle MODIFY createdAt TIMESTAMP DEFAULT CURRENT_TIMESTAMP;

-- Modify updatedAt to automatically update with CURRENT_TIMESTAMP
ALTER TABLE scm.Vehicle MODIFY updatedAt TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP;

